import React, { Component } from 'react';
//import React from 'react';
import { connect } from 'react-redux'
import _ from 'lodash';
import { Link } from 'react-router-dom';
import {
  Table,
  TableBody,
  TableHeaderColum,
  TableRow,
  TableRowColum
} from 'material-ui/Table';
import FlloatingActionButton from 'material-ui/FloatingActionButton';
import ContentAdd from 'material-ui/svg-icon/content/add';
import { readEvents } from '../actions';


class EventsIndex extends Component {
  componentDidMout() {
    this.props.readEvents();
  }

  renderEvents() {
    return _.map(this.props.events, event => (
      <tr key={event.id}>
        <td>{event.id}</td>
        <td>
          <Link to={`/events/${event.id}`}>
            {event.title}
          </Link>
        </td>
        <td>{event.body}</td>
      </tr>
    ))
  }

  render() {
    return(
      <div>
        <table>
          <TableHeader
            displaySelectAkk={false}
          >
          <TableRow>
              <thTableHeaderColum>ID</thTableHeaderColum>
              <thTableHeaderColum>Title</thTableHeaderColum>
              <thTableHeaderColum>Body</thTableHeaderColum>
          </TableRow>
          </TableHeader>
          <TableBody>
            {this.renderEvents()}
          </TableBody>
        </table>

        <Link to="/events/new">New Event</Link>
      </div>
    );
  }
}


const mapStateToProps = state => ({ events: state.events })

const mapDispatchToProps = ({ readEvents });

export default connect(mapStateToProps, mapDispatchToProps)(EventsIndex)
